sources.sass\\layout\\_header.scss:
.header {
  max-width: 1440px;
  margin: 0 auto;
  height: 459px;

  padding-top: 32px;
  padding-bottom: 64px;
  // background-image: linear-gradient(
  //     to right,
  //     rgba(0, 0, 0, 0.4),
  //     rgba(0, 0, 0, 0.4)
  //   ),
  //   url('../images/Hero_1x-min.png');
  background-image: url('../images/desktop/Hero_1x-min.png');
  background-repeat: no-repeat;
  background-size: cover;
  background-position: center;

   @media screen and (min-width: 480px) {
    background-image: url(../images/mobile/Hero_mobile_1x-min.png);
    @media screen and (min-device-pixel-ratio: 2),
      (min-resolution: 1920dpi),
      (min-resolution: 2dppx) {
      background-image: url(../images/mobile/Hero_mobile_2x-min.png);
    }
  }

  @media screen and (min-width: 768px) {
    height: 100vh;
    background-image: url(../images/tablet/Hero_tablet_1x-min.png);
    @media screen and (min-device-pixel-ratio: 2),
      (min-resolution: 1920dpi),
      (min-resolution: 2dppx) {
      background-image: url(../images/tablet/Hero_tablet_2x-min.png);
    }
  }

  @media screen and (min-width: 1200px) {
    background-image: url(../images/desktop/Hero_1x-min.png);
    @media screen and (min-device-pixel-ratio: 2),
      (min-resolution: 1920dpi),
      (min-resolution: 2dppx) {
      background-image: url(../images/desktop/Hero_2x-min.png);
    }
  }

  .header-position {
    display: flex;
    column-gap: 25px;

    .logo-wrap {
      display: flex;
      flex-direction: column;
      row-gap: 8px;
      margin: 0 auto;

      .menu-open {
        border: none;
        background-color: transparent;
        @media screen and (min-width: 768px) {
          display: none;
        }
      }

      .logo {
        display: block;
        width: 104px;
        margin-left: auto;
        margin-right: auto;
        font-weight: 500;
        font-size: 12px;
        text-transform: uppercase;
        text-align: center;
        color: #fffefa;

        &:hover {
          color: $primaryTextColor;
        }

        @media screen and (min-width: 768px) {
          width: 123px;
          font-size: 14px;
          text-align: left;
        }
        @media screen and (min-width: 1200px) {
          width: 380px;
          font-size: 22px;
        }
      }
    }

    .nav {
      display: none;

      @media screen and (min-width: 768px) {
        display: flex;
        justify-content: space-between;
        width: 100%;
      }
      @media screen and (min-width: 1200px) {
        // display: flex;
        // justify-content: space-between;
        // width: 100%;
      }

      .menu-item + .menu-item {
        margin-top: 8px;
      }
      .menu-link {
        font-size: 16px;
        color: #fffefa;

        &:hover {
          color: $primaryTextColor;
        }
      }

      .header-link {
        display: flex;
        height: 54px;
        border-radius: 30px;

        &:hover .header-link-text {
          background-color: $primaryTextColor;
          border: 1px solid #2c3847;
          color: #fffefa;
          box-shadow: 0 5px 16px #00000040;
        }
        &:active .header-link-text {
          background-color: #293441;
          border: 1px solid $primaryTextColor;
          color: #fffefa;
        }

        &:hover .header-link-arrow {
          background-color: $primaryTextColor;
          border: 1px solid #2c3847;
          box-shadow: 0 5px 16px #00000040;
        }
        &:active .header-link-arrow {
          background-color: #293441;
          border: 1px solid $primaryTextColor;
        }

        .header-link-text {
          width: 156px;
          height: 54px;
          border: 1px solid#FFFEFA;
          border-radius: 30px;
          padding: 16px 22px;
          color: #fffefa;
        }

        .header-link-arrow {
          @extend %centeredFlex;
          width: 56px;
          height: 54px;
          border: 1px solid #fffefa;
          border-radius: 50%;

          .icon-arrow-white {
            stroke: #fffefa;
            // stroke: $primaryTextColor;
          }
        }
      }
    }
  }

  .hero {
    margin-top: 209px;
    margin-left: auto;
    margin-right: auto;
    @media screen and (min-width: 768px) {
      margin-top: 238px;
    }
    @media screen and (min-width: 1200px) {
      // height: 696px;
      margin-top: 40vh;
    }
    .hero-title {
      font-weight: 500;
      font-size: 32px;
      line-height: 1.1;
      color: #fffefa;
      @media screen and (min-width: 768px) {
        width: 755px;
        font-size: 64px;
        font-weight: 700;
      }
      @media screen and (min-width: 1200px) {
        width: 1123px;
        font-size: 96px;
      }
    }
  }
}

sources.sass\\components\\_mob-menu.scss:
.mob-menu {
  position: absolute;
  top: 0;
  left: 0;
  width: 100vw;
  height: 459px;

  background-color: rgba(0, 0, 0, 0.7);

  @media screen and (min-width: 768px) {
    display: none;
  }

  &.is-hidden {
    opacity: 0;
    pointer-events: none;
  }

  .no-scroll {
    overflow: hidden;
  }

  .mob-menu-container {
    height: 100%;
    padding: 24px 16px;

    .mob-menu-header {
      display: flex;
      justify-content: space-between;

      .mob-menu-logo {
        width: 104px;
        height: 30px;
        color: rgba(255, 254, 250, 1);
        text-transform: uppercase;
      }

      .btn-close {
        border: none;
      }
    }

    .mob-menu-list {
      margin-top: 64px;

      .mob-menu-item {
        padding: 8px 0;
        .mob-menu-link {
          display: block;
          font-size: 20px;
          line-height: 1.4;
          text-align: left;
          color: #fffefa;
        }
      }

      .mob-menu-item:not(:last-child) {
        border-bottom: 1px solid #ffffff;
      }
    }
  }
}

sources.sass\\components\\_about.scss:
.about {
  padding-top: 64px;
  padding-bottom: 64px;

  @media screen and (min-width: 1200px) {
    padding-top: 96px;
    padding-bottom: 96px;
  }

  .content-box {
    margin-bottom: 36px;

    @media screen and (min-width: 768px) {
      display: flex;
      column-gap: 20px;
      margin-bottom: 42px;
    }
    @media screen and (min-width: 1200px) {
      column-gap: 56px;
      margin-bottom: 64px;
    }

    .section-content {
      // width: 730px;

      @media screen and (min-width: 768px) {
        width: 367px;
      }
      @media screen and (min-width: 1200px) {
        width: 730px;
      }

      .section-name {
        @extend %sectionName;
        margin-bottom: 24px;
        font-size: 14px;

        @media screen and (min-width: 768px) {
          margin-bottom: 32px;
           font-size: 16px;
        }
        @media screen and (min-width: 1200px) {
          margin-bottom: 40px;
        }
      }
      .section-title {
        @extend %sectionTitle;
        margin-bottom: 16px;

        @media screen and (min-width: 768px) {
           margin-bottom: 0;
          font-size: 42px;
          line-height: 1.1;
        }
        @media screen and (min-width: 1200px) {
          font-size: 64px;
          line-height: 1.1;
        }
      }
    }
    .section-info {
      @media screen and (min-width: 768px) {
        width: 367px;
        padding-top: 54px;
      }
      @media screen and (min-width: 1200px) {
        width: 431px;
        padding-top: 62px;
      }

      .section-text {
        @extend %sectionText;
      }

      .contact-link {
        margin-top: 16px;
        display: flex;

        @media screen and (min-width: 768px) {
          margin-top: 21px;
        }
        @media screen and (min-width: 1200px) {
          margin-top: 65px;
        }

        &:hover .contact-link-estimate {
          background-color: $primaryTextColor;
          outline: 1px solid #2c3847;
          color: #fffefa;
          box-shadow: 0 4px 16px #00000040;
        }
        &:active .contact-link-estimate {
          background-color: #293441;
          outline: 1px solid $primaryTextColor;
          color: #fffefa;
        }

        &:hover .contact-link-arrow {
          background-color: $primaryTextColor;
          outline: 1px solid #2c3847;
          box-shadow: 0 5px 16px #00000040;
        }
        &:active .contact-link-arrow {
          background-color: #293441;
          outline: 1px solid $primaryTextColor;
        }
        .contact-link-estimate {
          @include button(
            $width: 136px,
            $background-color: $primaryTextColor,
            $color: #fffefa
          );
        }
        .contact-link-arrow {
          @extend %centeredFlex;
          width: 56px;
          height: 54px;
          border-radius: 50%;
          border: 1.5px solid $primaryTextColor;
          background-color: $primaryTextColor;

          .icon-arrow-white {
            stroke: #fffefa;
          }
        }
      }
    }
  }

  .adv-list {
    display: flex;
    flex-direction: column;
    row-gap: 16px;

    @media screen and (min-width: 768px) {
      flex-direction: row;
      
      column-gap: 16px;
    }
    @media screen and (min-width: 1200px) {
      column-gap: 20px;
    }

    .adv-item {
      padding: 24px;
      background: #f4ebdf;
      @media screen and (min-width: 768px) {
        flex-basis: calc((100% - 32px) / 3);
        padding: 40px 24px 22px 24px;
      }
      @media screen and (min-width: 1200px) {
        flex-basis: calc((100% - 40px) / 3);
        padding: 40px 24px 40px 24px;
      }

      .adv-icon {
        margin-bottom: 24px;

      }
      .adv-name {
        margin-bottom: 24px;
        font-weight: 600;
        font-size: 16px;
        line-height: 1.15;
        color: $primaryTextColor;
        text-transform: uppercase;
        @media screen and (min-width: 768px) {
          font-size: 16px;
        }
        @media screen and (min-width: 1200px) {
          font-size: 20px;
        }
      }

      .adv-text {
        font-size: 16px;
        line-height: 1.15;
        color: $primaryTextColor;
      }
    }
  }
}

