          outline: 1px solid $primaryTextColor;
        }

        .estimate-link-est {
          @include button(
            $width: 156px,
            $background-color: #fff,
            $color: $primaryTextColor
          );
        }

        .estimate-link-arrow {
          margin-left: 2px;
          @extend %buttonArrow;

          .icon-arrow-black {
            stroke: $primaryTextColor;
          }
        }
      }
    }

    .section-img-box {
      display: none;
      @media screen and (min-width: 768px) {
        display: block;
        width: 367px;
        height: 420px;
        background: #d9d9d9;
        margin-bottom: 0;
      }
      @media screen and (min-width: 1200px) {
        width: 765px;
        height: 483px;
      }

      // .section-img-title {
      //   margin-top: 10px;
      //   font-size: 14px;
      //   line-height: 1.3;
      //   color: #7c7c7c;
      // }
    }
  }

  .examples {
    display: flex;
    flex-direction: column;
    row-gap: 16px;

    @media screen and (min-width: 768px) {
      flex-direction: row;
      align-items: center;
      column-gap: 16px;
    }
    @media screen and (min-width: 1200px) {
      column-gap: 20px;
    }

    .example {
      @media screen and (min-width: 768px) {
        height: 235px;
      }
      @media screen and (min-width: 1200px) {
        flex-basis: calc((100% - 40px) / 3);
        height: 313px;
      }

      .example-wrap {
        .example-title {
          margin-top: 10px;

          font-size: 14px;
          line-height: 1.3;
          color: #7c7c7c;
        }
      }
    }
  }
}

sources.sass\\components\\_reviews.scss:
.feedbacks {
  margin-bottom: 64px;

  .section-position {
    display: flex;
    flex-direction: column;
    row-gap: 24px;

    @media screen and (min-width: 768px) {
      flex-direction: row;
      column-gap: 20px;
    }
  }
  .section-content {
    @media screen and (min-width: 768px) {
      width: 367px;
    }
    @media screen and (min-width: 1200px) {
      width: 429px;
    }

    .section-name {
      @extend %sectionName;
      margin-bottom: 24px;
      @media screen and (min-width: 768px) {
        font-size: 16px;
        margin-bottom: 32px;
      }
    }
    .section-title {
      width: 305px;
      margin-bottom: 16px;
      @extend %sectionTitle;
      @media screen and (min-width: 768px) {
        width: 244px;
      }
    }
    .section-text {
      @extend %sectionText;
      margin-bottom: 16px;
      @media screen and (min-width: 1200px) {
        margin-bottom: 24px;
      }
    }
  }

  .carousel {
    &.desktop {
      display: none;
      @media screen and (min-width: 1200px) {
        display: block;
        width: 879px;
      }
    }
    width: 100%;
    @media screen and (min-width: 768px) {
      width: 367px;
    }
    @media screen and (min-width: 1200px) {
      display: none;
    }

    &-item {
      .reviews {
        display: flex;
        // flex-direction: column;
        // row-gap: 16px;

        @media screen and (min-width: 768px) {
          flex-direction: row;
          column-gap: 20px;
        }

        .review {
          position: relative;

          height: 316px;
          padding: 20px 24px;
          background: #f4ebdf;

          @media screen and (min-width: 1200px) {
            flex-basis: calc((100% - 20px) / 2);
          }

          .review-icon {
            margin-bottom: 16px;
            fill: rgba(33, 42, 53, 0.405);
          }

          .review-text {
            margin-bottom: 15px;
            font-size: 16px;
            color: #171717;
            line-height: 1.4;
          }
        }
      }

      &:not(:first-child) {
        //  margin-left: 20px;
        @media screen and (min-width: 1200px) {
          margin-left: 20px;
        }
      }
    }
  }
}

sources.sass\\components\\_contacts.scss:
.contacts {
  padding-bottom: 66px;
  @media screen and (min-width: 1200px) {
    padding-bottom: 96px;
  }

  .contact-box {
    @media screen and (min-width: 768px) {
      display: flex;
      column-gap: 20px;
      height: 642px;
    }
    @media screen and (min-width: 1200px) {
      height: 678px;
    }

    .contact-img {
      display: none;
      @media screen and (min-width: 768px) {
        display: block;
        width: 367px;
        height: 642px;
      }
      @media screen and (min-width: 1200px) {
        width: 565px;
          height: 678px;
      }
    }

    .contact-content {
      @media screen and (min-width: 768px) {
        width: 367px;
      }
      @media screen and (min-width: 1200px) {
        width: 747px;
      }

      .section-name {
        @extend %sectionName;
        margin-bottom: 24px;
        @media screen and (min-width: 768px) {
          font-size: 16px;
          margin-bottom: 32px;
        }
      }
      .section-title {
        width: 305px;
        margin-bottom: 16px;
        @extend %sectionTitle;
        @media screen and (min-width: 768px) {
          width: 244px;
           font-size: 38px ;
            //  margin-bottom: 24px;
        }
        @media screen and (min-width: 1200px) {
          width: 100%;
          font-size: 58px ;
            //  margin-bottom: 24px;
        }
      }
      .section-text {
        @extend %sectionText;
        margin-bottom: 16px;
        @media screen and (min-width: 768px) {
          display: none;
        }
        @media screen and (min-width: 1200px) {
          display: block;
          margin-bottom: 24px;
          width: 486px;
        }
      }

      .form {
        display: flex;
        flex-direction: column;

        .form-input {
          height: 53px;
          margin-bottom: 16px;
          padding: 16px;
          border: 1px solid $primaryTextColor;
          border-radius: 30px;
        }

        .form-area {
          height: 99px;
          margin-bottom: 16px;
          padding: 16px;
          border: 1px solid $primaryTextColor;
          border-radius: 30px;
          resize: none;

          .form-area::placeholder {
            font-size: 16px;
            line-height: 1.3;
            color: #818284;
          }
        }

        .policy-wrap {
          display: flex;
          align-items: start;
          margin-bottom: 16px;

          .checkbox-label {
            width: 622px;
            line-height: 1.5;

            .policy-link {
              color: inherit;
              text-decoration: underline;
            }
          }
        }

        .form-button {
          // border: 1px solid #000;
          border-radius: 30px;
          padding: 16px 24px;
          // width: 654px;
          height: 54px;
          background: $primaryTextColor;

          font-size: 16px;
          line-height: 1.4;
          color: #fff;

          &:hover {
            background-color: $primaryTextColor;
            outline: 1px solid #2c3847;
            box-shadow: 0 4px 16px #00000040;
          }
          &:active {
            background-color: #293441;
            outline: 1px solid $primaryTextColor;
          }

          &:disabled {
            background-color: #89898a;
            outline: 1px solid $primaryTextColor;
          }
        }
      }
    }
  }
}

sources.sass\\layout\\_footer.scss:
.footer {
  padding: 36px 0;
  background-color: #f4ebdf;

  @media screen and (min-width: 768px) {
    padding: 40px 0;
  }
  @media screen and (min-width: 1200px) {
    padding: 56px 0;
  }

  .footer-info {
    display: flex;
    justify-content: space-between;
    flex-wrap: wrap;
    row-gap: 32px;
    margin-bottom: 32px;
    @media screen and (min-width: 768px) {
      // display: flex;

      row-gap: 36px;
      margin-bottom: 36px;
      // justify-content: space-between;
    }
    @media screen and (min-width: 1200px) {
      // justify-content: space-between;
      flex-wrap: nowrap;
      margin-bottom: 64px;
      column-gap: 102px;
    }

    .logo {
      width: 50%;
      font-weight: 500;
      font-size: 23px;
      text-transform: uppercase;
      color: inherit;

      @media screen and (min-width: 768px) {
        // width: 50%;
      }
      @media screen and (min-width: 1200px) {
        width: 313px;
      }
    }

    .footer-menu-wrap {
      order: 2;
      @media screen and (min-width: 768px) {
        order: 1;
        // width: 33.3%;
      }
      @media screen and (min-width: 1200px) {
        order: 0;
      }
    }
    .footer-contacts-wrap {
      order: 1;
      width: 100%;
      @media screen and (min-width: 768px) {
        order: 2;
        width: 33.3%;
      }
      @media screen and (min-width: 1200px) {
        order: 0;
      }
    }
    .footer-socials-wrap {
      order: 3;
      @media screen and (min-width: 768px) {
        order: 3;
        // width: 33.3%;
      }
      @media screen and (min-width: 1200px) {
        order: 0;
      }
    }
    .footer-scroll-wrap {
      width: 50%;
      @media screen and (min-width: 768px) {
        width: 50%;
      }
      @media screen and (min-width: 1200px) {
        order: 0;
      }

      .footer-scroll-link {
        display: flex;
        flex-direction: column;
        align-items: end;
        color: inherit;
      }
    }

    .footer-socials-title,
    .footer-menu-title,
    .footer-contacts-title {
      margin-bottom: 16px;
      font-weight: 500;
      font-size: 14px;
      color: #867b7b;
    }

    .footer-social-list,
    .footer-menu-list,
    .footer-address-list {
      display: flex;
      flex-direction: column;
      row-gap: 8px;
    }

    .footer-social-link,
    .footer-menu-link,
    .footer-address-link {
      color: inherit;
    }

    .footer-social-link {
      width: 144px;
      display: flex;
      justify-content: space-between;
      align-items: center;

      .black-arrow-icon {
        stroke: $primaryTextColor;
        width: 12px;
        height: 12px;
        @media screen and (min-width: 768px) {
          width: 12px;
          height: 12px;
        }
      }
    }
  }

  .privacy-list {
    display: flex;
    justify-content: space-between;

    .privacy-link {
      color: inherit;
      text-decoration: underline;
      text-decoration-skip-ink: none;
    }
  }
}
